import Foundation

let base64Image: String = ""

struct ImageMock {
    
    var base64: String
    
    init(base64: String) {
        self.base64 = base64
    }
    
    func decode() -> Data {
        return Data(base64Encoded: base64) ?? Data()
    }
}
